import React from "react";
import HighlightOutlinedIcon from '@material-ui/icons/HighlightOutlined';
function Header() {
  return (
    <header>
      <h1><HighlightOutlinedIcon/>Keeper</h1>
    </header>
  );
}

export default Header;
